import React, { useEffect } from "react";
import { Row, Col, Button, Container } from "react-bootstrap";
import Judul from "./Judul";
import Aos from "aos";
export default function Header() {
  useEffect(() => {
    Aos.init({
      duration: 2000,
    });
  }, []);
  return (
    <div>
      <Container>
      <Row className="header-container">
        <Col>
          <Col>
            <Judul />
          </Col>
          <Col data-aos="zoom-in" className="sub-judul">
            <a>
              Hello, My name is <br /> Priandy Dwi Handika <br />
              kapan ya jadi Fullstack Developer
            </a>
          </Col>
          <Row style={{ marginTop: 10 + "px" }} data-aos="zoom-in">
            <Button variant="primary">
              :(
            </Button>
          </Row>
        </Col>
        <Col
          data-aos="fade-left"
          data-aos-anchor="#example-anchor"
          data-aos-offset="500"
          data-aos-mirror="true"
        >
          <Col>
            <img className="percom" src={"/assets/person2.png"} alt="percom" />
          </Col>
          <img className="person" src={"/assets/person.png"} alt="person" />
        </Col>
      </Row>
      </Container>
    </div>
  );
}
